import Footer from "./Footer";

function Display() {
  return (
    <div>
      <div>
        <img src="PERFUME img" />
      </div>
      <div>
        <h1>PERFUME Name</h1>

        <h4>PERFUME brand</h4>

        <h6>Size </h6>
        <h4> price </h4>
        <p>Description </p>
      </div>

      <Footer />
    </div>
  );
}
export default Display;
